import {
  Canvas,
} from '@react-three/fiber'
import {
  Grid,
} from '@mui/material';

import Info from './components/Info';

function App() {
  return (
    <>
      <Grid container>
        <Grid container item justifyContent="flex-end">
          <Info />
        </Grid>
        <Grid container item>
          <Canvas />
        </Grid>
      </Grid>
    </>
  );
}

export default App;
